DROP TABLE IF EXISTS postcode;

CREATE TABLE postcode (
    postcode                          VARCHAR(5)                       NOT NULL PRIMARY KEY,
    lon                               DOUBLE PRECISION                NOT NULL,
    lat                               DOUBLE PRECISION                NOT NULL,
    postcode_extension_distance_group VARCHAR(255) DEFAULT 'group_a'  NOT NULL,
    created_at                        TIMESTAMP(6) WITHOUT TIME ZONE NULL,
    updated_at                        TIMESTAMP(6) WITHOUT TIME ZONE NULL
);

COMMENT ON COLUMN postcode.created_at IS '(DC2Type:datetime_immutable)';
COMMENT ON COLUMN postcode.updated_at IS '(DC2Type:datetime_immutable)';

